import Link from "next/link";
import { useRouter } from "next/router";
const Navbar = () => {
  const router = useRouter();

  const handleClick = e => {
    e.preventDefault();
    router.push("/4");
  };
  return (
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
      <li>
        <span onClick={() => Router.push("/post/[pid]", "/post/abc")}>
          Click me
        </span>
      </li>
    </ul>
  );
};

export default Navbar;
